def mixed_scrambled():
  with open("xbbs") as main:
    moon = main.read()
    l = moon.replace("\n","")
    y = len(l)
    n = 4
    t = int(y/n)
    x = sys.argv[1] #1234
    k = ""
    if (t % len(x)) == 0:
      y = t / len(x)
      k = x * int(y)
    else:
      n = t % len(x)
      core = int((t - n) / len(x))
      x = core*(x)
      split_string = [x[i:i+n] for i in range(0, len(x), n)]
      list1 = split_string[0:1]
      string1=""
      for i in list1:
        string1=string1+i
      k = x + string1
    n = 4
    l = [l[i:i+n] for i in range(0, len(l), n)]
    k = sorted((b:=sorted(range(len(k)), key=lambda x: k[x])), key=lambda x: b[x])
    k = list(reversed(k))
    k = [1 + i for i in sorted(range(len(k)), key=k.__getitem__)]
    k = sorted((b:=sorted(range(len(k)), key=lambda x: k[x])), key=lambda x: b[x])
    st = [x for _,x in sorted(zip(k,l))]
    st = "".join(st)
    with open("xrrs", 'w') as outfile:
      outfile.write(st)
mixed_scrambled()

